        super(props);
    }
    
    CurrentArea = (historyMode) => {
        if (history === 1 && statistics === 0) {
            return (
                <List></List>   
            )
        } else {
            return (
            <Statistics></Statistics>
            )    
        }
    }
    render() {
        let {history} = this.props;
        return (
            <div className="working-area">
                <CurrentArea></CurrentArea>
